import { TextField } from '@mui/material';
import { makeStyles } from '@mui/styles';
import { createTheme } from '@mui/system';
import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { ThemeProvider } from 'styled-components';
import "./CoinTable.css"
import { CoinList } from './config/Api';

const CoinTable = () => {

  const [coins, Setcoins] = useState([]);
  const [loading, setloading] = useState(false);
  const[search , Setsearch] = useState();

  const fetchCoins = async () => {
    setloading(true);
    const res = await axios.get(CoinList("USD"));
    setloading(false);
    Setcoins(res.data);


  }

  useEffect(() => {
    fetchCoins();
  }, [])

  console.log(coins);

  const darkTheme = createTheme(({
    palette: {
      main: "#fff"
    },
    type: "dark",
  }));

  const useStyles = makeStyles(()=>({
    textField:{
      border: '1px solid white'
    }
  }))

  const classes = useStyles();

  return (
    <ThemeProvider theme={darkTheme}>
      <div className='table' style={{ textAlign: "center" }}>
        <h4>
          Cryotocurrency prices by market Cap
        </h4>
        <TextField id="outlined-basic" label="search for a Crypto Currency..." className={classes.textField} variant="outlined" style={{marginBottom: 20, width: "80%" , color: "#fff"}}
         onChange = {(e)=>Setsearch(e.target.value)}
         />
      </div>
    </ThemeProvider>
  )
}

export default CoinTable;
